Xlist4new[n_,mu_,x_,J_] := Table[Xlist4[i,mu,x][[J/2+1]],{i,3/2,41/2,1}] . coefflist[[n-3/2]];
Xlist6new[n_,mu_,x_,J_] := Table[Xlist6[i,mu,x][[J/2+1]],{i,3/2,41/2,1}] . coefflist[[n-3/2]];
Xlist8new[n_,mu_,x_,J_] := Table[Xlist8[i,mu,x][[J/2+1]],{i,3/2,41/2,1}] . coefflist[[n-3/2]];
Xlist10new[n_,mu_,x_,J_] := Table[Xlist10[i,mu,x][[J/2+1]],{i,3/2,41/2,1}] . coefflist[[n-3/2]];
NC[x_,J_,d_]:=1/x-(J (7+J))/(2 x);
NC1[x_,J_,d_]:=(J (7+J) (-23+7 J+J^2))/(10 x^4);
NC2[x_,J_,d_]:=-((J (7+J) (954-497 J-22 J^2+14 J^3+J^4))/(60 x^7));


PolySmall[J_, x_, y_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,y],{{Flatten[Cancel[x^(Max[J,10])*{Table[Simplify[Expand[Cimp2list[n ,x, J]]],{n,3/2,num1}], Table[Simplify[Expand[Nlist[n,x,J]]],{n,0,nulllist[[1]]}]}]]}}];
PolyMiddle[J_, x_, y_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,y],{{Flatten[{Table[Simplify[Expand[Cimp2list[n ,x, J]]],{n,3/2,num1}], Table[Simplify[Expand[Nlist[n,x,J]]],{n,0,nulllist[[1]]}]}]}}];
PolyLargeJ[J_, x_, y_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,y],{{Flatten[Simplify[{Table[0,{n,3/2,num1}], Table[(1*mu3+10*mu3*x)^10 * Nlist2[n,(1*mu3+10*mu3*x)/(1+x),J],{n,0,nulllist[[1]]}]}]]}}];
NewPoly[b_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,x],{{Flatten[{Table[(G[i, 10, b, 1/mu2] + B[i, 10, b, 1/mu2]),{i,3/2,num1}], list0}],Flatten[{Table[(F[i, 10, b, 1/mu2]),{i,3/2,num1}], list0}]},
        {Flatten[{Table[(F[i, 10, b, 1/mu2]),{i,3/2,num1}], list0}],Flatten[{Table[(G[i, 10, b, 1/mu2] - B[i, 10, b, 1/mu2]),{i,3/2,num1}], list0}]}}];

Polydis[b_, x_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,x],{{Flatten[{Table[H[n,10,b, 1/mu2],{n,3/2,num1}], list0}]}}]        
